import React from "react";

import { Link, Navbar, NavbarBrand } from "@nextui-org/react";

const Header = () => {
  return (
    <Navbar variant="floating" isBordered>
      <NavbarBrand>
        <Link href="/">
          <text>Книга жалоб и предложений</text>
        </Link>
      </NavbarBrand>
    </Navbar>
  )
}

export default Header;
